ISLAMABAD, Aug 03 (APP):Special Assistant to the Prime Minister on Political Communication Dr Shahbaz Gill on Tuesday felicitated Anwar ul Haq upon his election as Speaker Azad Jammu and Kashmir Legislative Assembly.
In a tweet, he expressed best wishes to the newly elected Speaker for discharging his duties under the vision of Prime Minister Imran Khan..
